use regex::Regex;

pub fn find_main_js(homepage_html: &str) -> Option<&str> {
    let re = Regex::new(r"https://abs\.twimg\.com/responsive-web/client-web/main\.[a-f0-9]+\.js").unwrap();
    re.find(homepage_html).map_or(None, |m| Some(m.as_str()))
}

